block.ml:
fun updateCartPD(cC, dR) =
					let
					  val dRA = dR - DADMPD
					  val mdRA = abs dRA
					in
					  if dRA >= 0.0 then 1`(4, (cC - DADMPD/1.0))
					  else 
					    if mdRA <> DADMPD then 1`(4, (cC - dR/1.0))
					    else empty
					end;
						  fun updateCartPD(cC, dR) =
					let
					  val dRA = dR - DADMPD
					  val mdRA = abs dRA
					in
					  if dRA >= 0.0 then 1`(4, (cC - DADMPD/1.0))
					  else 
					    if mdRA <> DADMPD then 1`(4, (cC - dR/1.0))
					    else empty
					end;

fun updateCartPD2(cC, dR) =
					let
					  val dRA = dR - DADMPD
					  val mdRA = abs dRA
					in
					  if dRA >= 0.0 then 1`(cC - DADMPD/1.0)
					  else 
					    if mdRA <> DADMPD then 1`(cC - dR/1.0)
					    else empty
					end;
						  fun updateCartPD2(cC, dR) =
					let
					  val dRA = dR - DADMPD
					  val mdRA = abs dRA
					in
					  if dRA >= 0.0 then 1`(cC - DADMPD/1.0)
					  else 
