					    else empty
					end;

fun cFATPD(dRA) = 
					if (dRA - DADMPD) <= DADMPD then 1`()
					else empty
						  fun cFATPD(dRA) = 
					if (dRA - DADMPD) <= DADMPD then 1`()
					else empty

